function namespace(e,t){if(typeof e!=="string"){throw'Namespace must be string but it is: "'+e+'"'}if(this!==undefined&&this instanceof namespace){throw'This function is not supposed to be called with the "new" keyword'}var n=e.split(".");var i;switch(typeof t){case"undefined":i=this;break;case"number":case"string":case"boolean":case"function":i=t;break;case"object":if(t===null){throw"Alternative root cannot be null"}else{i=t}break;default:throw"Alternative path cannot be of this type: "+typeof t}if(i===undefined){throw"Can't attach the namespace to something"}for(var a=0;a<n.length;a++){var o=n[a];if(o.length===0){continue}if(!/^[a-z\$_]/i.test(o.charAt(0))){throw'Identifier should start with a letter, underscore or dollar sign: "'+o+'"'}if(!/^[\w\$_]+$/.test(o)){throw'Invalid identifier: "'+o+'"'}if(typeof i[o]!=="object"||i[o]===null){i[o]={}}i=i[o]}return i}